import React from 'react'
import { useState } from 'react'

function CreateProject() {

  const [projectData, setProjectData] = useState([])
  const [projectName, setProjectName] = useState('')
  const [projectDescription, setProjectDescription] = useState('')
  const [projectLocation, setProjectLocation] = useState('')
  const [projectGenre, setProjectGenre] = useState('')

  const handleSubmit = (e) => {
    e.preventDefault()
    fetch('/projects/create', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json'
      },
      body: JSON.stringify(projectData)
    })
    .then(response => response.json())
    .then(data => {
      console.log(data)
      setProjectData(data)
    }
    )
  }





  return (
    <div>
      <form value={projectData} onSubmit={handleSubmit}>

        <h1>Create your project!</h1>

        <label>Project Name</label>
        <br></br>
        <br></br>
        <input type="text" name="projectName" placeholder="Project Name" />
        <br></br>
        <br></br>
        <label>Project Description</label>
        <br></br>
        <br></br>
        <textarea name='projectDescription' placeholder='Describe your project' rows="4" cols="50"></textarea>
        <br></br>
        <br></br>
        <label>Project Location</label>
        <br></br>
        <br></br>
        <input type="text" name="projectLocation" placeholder="Project Location" />
        <br></br>
        <br></br>
        <label>Project Genre</label>
        <br></br>
        <br></br>
        <input type="text" name="projectGenre" placeholder="Project Genre" />
        </form>
    </div>
  )
}

export default CreateProject
